define({"topics" : [{"title":"System Prompt","shortdesc":"\n               <p class=\"shortdesc\">The default system prompt language is English. You can change the global system prompt,     and if an extension user works\n                  in a foreign language, you can set a different system prompt for     the user.\n               </p>\n            ","id":"topic_w3p_gmc_5cb","href":"topic\/system_prompt.html","menu": {"hasChildren":false,},"tocID":"topic_w3p_gmc_5cb-d46e14822","next":"topic_w3p_gmc_5cb-d46e14822",},{"title":"Music on Hold (MoH)","shortdesc":"\n               <p class=\"shortdesc\">Music on hold (MoH) is the business practice of playing recorded music to fill the     silence that would be heard by callers\n                  who have been placed on hold. \n               </p>\n            ","id":"topic_f1w_zwc_5cb","href":"topic\/music_on_hold.html","menu": {"hasChildren":false,},"tocID":"topic_f1w_zwc_5cb-d46e15114","next":"topic_f1w_zwc_5cb-d46e15114",},{"title":"Custom Prompt","id":"topic_zrr_ffk_5cb","href":"topic\/custom_prompt.html","menu": {"hasChildren":false,},"tocID":"topic_zrr_ffk_5cb-d46e15333","next":"topic_zrr_ffk_5cb-d46e15333",},{"title":"Set Prompts for Failed Calls ","shortdesc":"\n               <p class=\"shortdesc\">A user may fail to make outbound calls due to many reasons, such as the trunk is         busy, no trunk available, or invalid\n                  number. You can set different prompts to inform the         user why the call fails.\n               </p>\n            ","id":"task_v4s_4zq_5cb","href":"topic\/set_prompts_for_failed_calls.html","menu": {"hasChildren":false,},"tocID":"task_v4s_4zq_5cb-d46e15838","topics":[]}]});